		let fee 							= Number(this.state.fee)/Math.pow(10,config.ASSET_PRECISION).toFixed(config.ASSET_PRECISION);;
		let payable_amount		= discount_dsc+fee;
		let balance 					= this.props.balance[config.ASSET_ID];
